package playlist;

import songs.Song;

import java.util.ArrayList;

public class Playlist {
    public String playlistTitle;
    public String playlistAuthor = "";
    public String playlistDescription;
    public String image;
    public ArrayList<SongHash> songs = new ArrayList<>();

    public Playlist(String title, String desc, String image) {
        playlistTitle = title;
        playlistDescription = desc;
        this.image = image;
    }

    public void addSong(Song song) {
        songs.add(new SongHash(song.id));
    }

    private static class SongHash {
        public final String hash;

        public SongHash(String hash) {
            this.hash = hash;
        }
    }
}

